INSERT INTO `Curso_comentario` (`id_curso`, `comentario`) VALUES
(16636, 'Cumple con las expectativas.'),
(16637, 'Buen profesor'),
(16637, 'Muy buen maestro, de los pocos que valen la pena'),
(16638, 'Buen profesor.'),
(16639, 'Buen profesor.'),
(16640, 'Bueno profesor.'),
(16641, 'Un buen profesor.'),
(16642, 'Es un gran profesor, en él se nota su vocación.'),
(16642, 'Realmente es buen profesor.'),
(16642, 'Buen docente'),
(16642, 'Es un buen maestro'),
(16642, 'Bien'),
(16642, 'Muy buen profesor'),
(16643, 'ni pensar en preguntarle asesorías porque durante su clase, solo le dices: espere 1 minuto maestra, no entendí y enseguida ella se molesta y empieza a decir cosas como: ayy ustedes van lento, no podemos atrasarnos, que porquería sinceramente, saben del tema pero para enseñar es lo peor'),
(16643, '0/10 le recomendaria a la docente trabajar con su manejo de las emociones, ya que parece que se enfada con facilidad pero sin demostrarlo, y el las practicas realizadas en clase tanto como el las exposiciones se muestra un poco indiferente.'),
(16643, 'Excelente profesora, tiene un buen control de mando en el salón, explica muy detalladamente, es el ejemplo de un excelente profesor de Universidad pero el unico defecto que tiene es que no sabe comprender las situaciones de nosotros los alumnos, tiene que aprender a ser un poco más humana.'),
(16643, 'Bien'),
(16644, '10/10 el profe cumple con todo y si llega 5 minutos tarde, se disculpa y las clases da sus temas y pregunta muchas veces si entendimos o no y si nadie dice nada, el profe vuelve a explicar, larga vida para el doctor tellez!'),
(16644, '10/10 su catedra no aburre, además de ser paciente y comprensivo en su materia y en otros topicos.'),
(16644, 'Magnifico Profesor'),
(16644, 'Bien'),
(16645, '2/10 regular'),
(16645, 'Es un profesor muy adaptable, al principio llego muy duro pero con el paso de los dias empezo a ser más amable y ahora es un gran profesor porque se presta a explicarnos detallamente nuestras dudas en clases. Como tutor es increible porque tiene un buen manejo de autoridad y organizaciones a sus actividades, a difetrencia del tutor anterior que se dejaba doblegar por los comentarios de los demas y ya no se podia llevar acabo actividades en grupo. Un punto de vista que me gustaria para el siguiente cuatrimestre es que nos puedan llevar a excurciones en grupo y poder conocer áreas de trabajo donde podamos destacar por nuestra carrera.'),
(16645, 'Bien'),
(16646, '7/10 sin pena ni gloria.'),
(16646, 'En ete cuatrimestre el Profesor se veia más tranquilo y menos estresado, quiero creer por'),
(16646, 'Bien'),
(16646, 'Buen profesor'),
(16647, '8/10 buenos temas'),
(16647, 'Es un buen Profesor pero en este Cuatrimestre estuvo muy flojo en el aspecto de que este Cuatri fue pura teoria con el y en vez de hacerlo interesante lo hizo ver muy aburrido porque solo se la pasa leyendo las dichas Diapositivas.'),
(16647, 'Bien'),
(16648, '8/10 regular y bueno.'),
(16648, 'Bien'),
(16648, 'Buenas explicaciones'),
(16649, 'no enseña nada, siempre dice \"esto ya se lo deben saber\" entonces para que es docente o le pagan por dar su clase si lo único que hace es dejar una tarea y decir eso? sin siquiera dar un ejemplo antes de pasar eso, y los ejemplos que dan son una basura con malísima explicación, definitivamente como contadora es buena pero como docente para enseñar, es lo peor'),
(16649, '0/10 en algunas ocasiones llega tarde a dar la clase, poco o nulo interes para enseñar y solo son lecturas de pdf sin ejercicios REALIZADOS EN CLASE solo en casa en sintesis una mala experiencia.'),
(16649, 'Es una excelente profesora, sus clases son muy entretenidas, una observacion o una idea seria que nos lleve de excursion relacionado al tema de la materia y de la carrera para que no siempre estemos encerrados en el salón, esto nos ayudaria amantener la motivacion por la carrera.'),
(16649, 'Excelente profesora'),
(16649, 'Buen contenido de la materia'),
(16650, 'Es un profesor muy dinámico'),
(16650, 'Se contradice en lo que pide en sus proyectos.'),
(16650, 'La única situación con este profesor es que se contradice en varias ocasiones, sobre todo cuando pide trabajos.'),
(16651, 'Es un excelente profesor, enseña muy bien.'),
(16651, 'Es de los profesores más decentes del curso.'),
(16653, 'La forma de evaluar la cambia cada que se le antoja. Los acuerdos que propone de igual forma los altera perjudicando a bastantes alumnos. Da la clase cada que se le antoja y no respeta los tiempos de su clase ( no da los 10 min por hora e invade el horario de los demás profesores).'),
(16653, 'Solo da clase cuando quiere. No respeta los 10 min que se nos debe de dar y además invade la clase de otros profesores extendiendo su clase. Cambia cada que se le antoja su manera de calificar. Por último pero no menos importante, no respeta los acuerdos modificando a cada rato sin nuestro consentimiento.'),
(16654, 'es un excelente profesor enseñando'),
(16654, 'El docente tiene un exelente dominio de los temas y está capacitado para impartir ese conocimiento de forma asertiva, así mismo se está actualizando en el tema constantemente para da una clase más detallada pero sin desviarse o perderse en la información siempre complementado para impartir su conocimiento de una forma más amplia y con diferentes fuentes.'),
(16655, 'Realiza con normalidad comentarios machistas'),
(16655, 'Buen profe'),
(16657, 'Me gustan mucho sus clases, son temas precisos, bien organizados y dispuesta a ayudar a los alumnos que lo requieran. Siga así.'),
(16657, 'SUS CLASES SON MUY INTERESANTES.'),
(16657, 'Gran desempeño'),
(16658, 'Gran desempeño'),
(16658, '10/10 buen balance de aplicación y enseñanza.'),
(16658, 'Buen maestro, unicamente me gustaría que no cancele las clases con poca anticipación y muy consecutivamente, tambien la revision de tareas podria ser más interactiva.'),
(16659, 'LAS CLASES SIEMPRE SON INTERESANTES.'),
(16659, 'Excelente'),
(16659, 'Me agradan sus clases, son muy dinámicas y concisas, de igual forma, el maestro explica con mucha claridad y ofrece retroalimentaciones a los comentarios y tareas.'),
(16660, 'ME GUSTAN MUCHO SUS CLASES'),
(16660, 'Buenas clases, me gustaría que incitara más a la comunicación entre nosotros para practicar más y quitar la pena.'),
(16660, 'Excelente'),
(16661, 'La verdad es un pésimo docente, hace comentarios muy fuera de lugar, ofensivo con la intención de atacar y crear conflictos con el estudiante. ME parece pésima su clase ya que nunca comparte los temas que tocará en su clase. Cada día cambia de opinión y ni siquiera utiliza la plataforma oficial para asignar tareas. Todo lo hace de manera informal y hace comentarios homofobicos, misoginos y machistas. Espero nunca más lo vuelvan a contratar porque no da la talla. Además habla mal de los alumnos a sus espaldas, dice qwue somos conflictos, además dejó un proyecto de un dia para otro y nos dejó exponer un tema que ni el sabe. Además la escuela es laica y el profesor predicta su religión y su política. Con decirle que expusimos un tema y duramos una hora y nunca nos dio retroalimentación,cualquier cosa a mi correo.'),
(16661, 'Es un profesor que no usa un lenguaje formal en clase y en ciertas ocasiones hace comentarios incomodos, su opinión la hace única esperando que las tareas que deja sea lo que el dijo, deja tareas que requieren análisis y un periodo amplio para realizarlas de un día para otro, el método de entrega de las tareas es por WhatsApp y no responde a dudas para realizarlas en el grupo, habla mal de las personas cuando salen del salón y no respeta los tiempos de descanso entre clase.'),
(16662, 'Me gustaría que sus clases fueran más dinámicas y no solo presentar diapositivas y copiar, de igual forma que de una retroalimentación a las tareas ya que no se sabe si están correctas o incorrectas.'),
(16662, 'no respeta los 10 min por cada hora, y solo deja tarea de casa'),
(16662, 'Gran desempeño'),
(16662, 'Buen maestro.'),
(16663, 'HACE LAS CLASES INTERESANTES'),
(16663, 'Gran desempeño del docente'),
