(16722, 'Buen profesor, te hace reflexionar'),
(16722, 'De manera personal siento que sus clases se trataron más de sexualidad que de ética en el trabajo, quizá sea una forma de mantener a los chavos \"interesados\" en la clase pero al final todo se veía resumido en eso y creo que existe mucho material para poder aprender sobre esta materia que no se vio en sí.'),
(16723, 'Una profesora excelente, sabe mantener la clase entretenida y maneja muy bien los temas, sabe explicar todo'),
(16723, 'Tiene un excelente dominio del tema, es muy buena profesora en general.'),
(16724, 'No da clases, nos deja investigaciones y no da retroalimentación de ningún tipo, sus exámenes no presentan información del temario, son confusos y extremadamente ridículos. Nada más porque nadie de mi salón ha dicho nada, pero no sé qué hace como docente o facilitador.'),
(16724, 'La profesora ha sido muy comprensible con nosotros, es muy muy amable, atiende cualquier tipo de duda ya sea en temas de teoría como en los ejercicios ya que es una materia super compleja y por ende ha sido con nosotros muy pacientes'),
(16724, 'Me parecen demasiado deficientes las clases que imparte este docente, muy pocas veces nos ha \"intentado\" dar clases pero no logra captar la atención de casi nadie. La mayoria de veces espera a que nosotros hagamos los temas que el deberia explicar. Deja tareas por montones en la plataforma pero no las revisa ni da retroalimentación sobre el tema que se está investigando. Sella las tareas sin ver si están bien o mal, podría decirse que sella cualquier cosa. Debido a que no retroalimenta las tareas ni las revisa, cree que en el examen vamos tener el conocimiento que deberiamos tener pero él no hace el minimo esfuerzo por la clase. En la unidad 3 nos dejó puras tareas pero no avisó de ellas y solo tuvimos dos clases de esa unidad, de las cuales nos dejó ver 2 videos. En el examen presentó esquemas que nunca vimos y que él pretendia que nos supiesemos de memoria. Un día no llegó a clases y no avisó el por qué de su ausencia, y teníamos laboratorio en ese día pero se canceló por su ausencia. Espero que no nos siga dando clases este docente en siguientes cuatrimestres por que parece que se toma a chiste su papel de maestro, podrá ser \"bueno\" para dirigir y orientar proyectos, pero como docente no llena el saco. Podrá ser buena persona, pero por docentes como él, cada día le pierto más esperanzas a la universidad.'),
(16724, 'Podría mejorar en prácticamente todo.'),
(16724, 'Es un profesor dedicado y sabe enseñar los temas, además te hace pensar sobre como usar los conocimientos'),
(16724, 'Es un buen profesor, si tienes dudas y la intención de preguntar y aprender tiene toda la disponibilidad de apoyarte, quizá podría involucrarse más en la parte didáctica aunque su principio de clase sea autodidactica, para mantener más el interés de sus clases'),
(16725, 'El maestro de ingles ha sido lo mejor con respecto a su amabilidad, empatía, accesibilidad, con diferentes temas de inglés por ende dentro del salón hemos tenido un buen ambiente entre maestro y alumno'),
(16725, 'Un muy buen profesor, espero que siga impartiendo la asigantura de inglés a mi grupo'),
(16725, 'Es un buen maestro, con él he aprendido bastante aunque a veces no nos ha dado varias clases él siempre trata de reponerlo con actividades.'),
(16725, 'Buen profesor sabe enseñar bien el inglés, es mejor que los otros profesores de ingles'),
(16725, 'Buen profe, explica bien'),
(16726, 'El profesor en general ha sido una persona muy accesible, los temas vistos en clase ha sido muy claro, es muy puntual con respecto a los horarios, es muy buen maestro'),
(16726, 'Muy buen profesor'),
(16726, 'Buen profesor'),
(16726, 'Creo que es de los mejores maestros de ma universidad, explica temas de una manera en la que no te aburres, sin embargo solo los explica con ejercicios, nunca he visto una presentación o video jaj'),
(16726, 'Es un profesor que sabe medir su tiempo, es ordenado y explica de manera sencilla para que podamos entender mejor'),
(16726, 'Es bueno con los dominios de temas pero su empatía hacia los alumnos no es tan buena, varias veces me ha hecho sentir menospreciada en sus clases, sin tomar en cuenta mis aportes o mis dudas, situación que no solo he notado yo, sino también varios compañeros. Quizá podría comenzar a tener más empatía por las personas y no ser tan cuadrado ante ciertas situaciones.'),
(16727, 'Es un buen profesor, ya que siempre en sus clases está motivado y le gusta hablar mucho de la biología'),
(16727, 'Buen profesor, es muy bueno explicando y muestra mucho interés por los temas, sin embargo, estaría bien que los temas que enseña fueran más acorde al programa.'),
(16728, 'Excelente profa, siempre nos brinda retroalimentación y apoya fuera de clases'),
(16728, 'Buena profesora en general, nunca ha faltado información y está interesada en nuestro aprendizaje.'),
(16729, 'Todo bien con la profesora solo anadiría que fuera un poco más dinámica su clase'),
(16729, 'Muy buena profesora, siempre abarca todo el temario disponible y nos proporciona de fuentes bibliográficas e información, sin embargo, sería bueno mejorar la presentación de la información o la manera en la que se nos transmite.'),
(16730, 'Solo me quedaría añadir que en cuanto a lso circuitos que realizamos son temas que necesitan un tiempo apto para poder analizarlos y posteriormente hacerlos'),
(16730, 'Buen profesor en general, sin embargo un poco cuestionable en sus maneras de evaluar y enseñar.'),
(16731, 'Excelente profesora. Muy dedicada y preocupada por nuestro aprendizaje manteniendo un buen ambiente en clase.'),
(16732, 'Muy buen profesor, siempre mantiene el ritmo de aprendizaje en clase con buen ambiente y fomenta mucho la participación.'),
(16733, 'Excelente profesora. Define el concepto de profesora de universidad de calidad bastante bien.'),
(16733, 'No respeta sus horas asignadas y toma hora de otros profesores así como horas fuera de la escuela'),
(16733, 'EXCELENTE CALIDAD'),
(16734, 'Buen profesor'),
(16734, 'Excelente docente. Explica detalladamente los contenidos del temario, despeja las dudas de una forma sencilla y clara. Excelente profesor:-)'),
(16734, 'Un exelente maestro, para mí el mejor, suban le el sueldo también'),
(16735, 'EXCELENTE PROFESOR EN TODO ASPECTO. DÉJENLO EN BIOTECH PARA 16 AM'),
(16735, 'Buen profesor.'),
(16735, 'Excelente profesor'),
(16735, 'Excelente docente.'),
(16735, 'Explíca bien pero va muy rápido en los temas'),
(16736, 'Buena profesora'),
(16736, 'Muy buena teacher:-)'),
(16736, 'Es una exelente maestra, si se aprende con ella'),
(16737, 'Buen profesor'),
(16737, 'Excelente docente, en cada clase promueve la ética y el como ser un buen ser humano en todos los ámbitos (social, académico,profesional,etc.). El material didáctico proporcionado resulta muy útil para comprender mejor los conceptos. Excelente docente.'),
(16737, 'Buen maestro y eso que odio los psicólogos'),
(16738, 'Excelente profesor, sabe mucho, explica y ayuda con asesorias si lo necesitas'),
(16738, 'Explica los contenidos de la materia detalladamente, promueve la sana convivencia en el aula. Sus clases motivan a seguir aprendiendo sobre la materia y carrera. Es paciente y muy buen docente. Excelencia en todo. Por más docentes así por favor.'),
(16738, 'Los alumnos que dicen que no es buen maestro mienten, solo no entienden o son lentos, también a él aumentenle el salario'),
(16739, 'Un muy buen profesor, explica demasiado bien'),
(16739, 'Muy buen profesor, explica claramente los contenidos y los temas, sus métodos de evaluación son innovadores y tecnologicos. Excelente.'),
(16739, 'Muy bien'),
(16739, 'También a él aumentenle el sueldo'),
(16740, 'Excelente profesor, sabe mucho espero siga dando clases a mi grupo'),
(16740, 'EXCELENTE PROFESOR EN TODO EL SENTIDO DEL PROFESOR. DENLE UN AUMENTO POR FAVOR:-)'),
(16740, 'Pone temas que no van con la materia de inorganiaca se adelanta'),
(16740, 'Aumentenle el suelo se lo merece'),
(16741, 'Que mezclé horarios con los de la mañana'),
(16744, 'Es muy buen profesor y tutor, siempre resuelve nuestras dudas'),
(16744, 'Muy buen profe, solo haría falta utilizar el laboratorio para comprender físicamente los temas.'),
(16745, 'Muy buena profesora, lo que estaría bien es poder entrar a laboratorio con esta materia.'),
(16747, 'Es bueno, solo falta que explique los ejercicios que deja y el por qué di mi error'),
(16747, 'Por favor, ayudaría saber dónde hay errores en el trabajo y no solo indicar que está mal'),
(16751, 'es muy grosera, nos grita cuando no entendemos ,poco empática , no tiene paciencia, dice comentario ofensivos'),
(16751, 'Comentarios ofensivos,grosera,poca paciencia,al tener duda te grita,poca empatica todo el tiempo regaña'),
(16751, 'que cambie su forma de ser con los alumnos y se centre en dar su clase, si el alumno no quiere aprender es problema de él, y que cuando se le haga una pregunta, no cuente toda su vida de como aprendió a hablar inglés y solo responda la duda del compañero.'),
(16752, 'Que nos pudieran más horas de la materia o 1 día que tengamos 2 horas seguidas'),
(16753, 'El mejor maestro'),
(16753, 'Es un buen profesor, tiene los conocimietos necesarios y su manera de enseñar nos hace buscar a nosotros mismos el conocimiento.'),
(16753, 'exelente profesor'),
(16753, 'Es un buen maestro, siempre es comprensivo con los temas, nos apoya con algunas dudas que tengamos de otra materia. Nos da actividades para puntos.'),
(16754, 'Es buena la maestra pero al inicio del cuatrimestre no dio fundamentos para entender que grupo funcional y varios de mis compañeros no entienden muchas cosas'),
(16754, 'A la maestra le falta dar mas claros los temas de bioquímica, ya que muchos a veces no nos queda claro y necesitamos que nos lo expliquen mas de 1 vez, o que vaya más lento en la explicación para entender el proceso que lleva cada cosa... Y poder tener un buen desempeño academico'),
(16755, 'Buen profesor. Exige pero nos da muy comoleta su materia.'),
(16755, 'Da muy completas sus clases y siempre nos da ejemplospara entender mejor los temas'),
(16756, 'Conoce muy bien su tema. Nos deja exposiciones y nos perdemos (se refleja en nuestras calificaciones) pero da buenas retroalimentaciones. Muy buena'),
(16756, 'Excelente profesora'),
(16756, 'Es una excelente maestra y siempre nos da claros los temas de clase'),
(16757, 'Muy buena profesora, solo que a veces sentíamos que era mucha información muy rápido y sobre las practicas estaría bien que realizara los dibujos de los músculos junto con los alumnos para mejor entendimiento.'),
(16757, 'Amable y profesional'),
(16757, 'Maestra que enseña con amor al enseñar y le dedica el tiempo suficiente para que aprendamos de la mejor manera.'),
(16758, 'Deben dejarla usar más el laboratorio'),
(16758, 'Nos gustaría que pudiera explicar más claramente y con más fluides los temas, hubieron muchos temas los cuales no se lograron comprender.'),
(16758, 'Siempre enseña y explica muy bien sus clases, explica hasta que las dudas desaparezcan, es muy trabajadora y siempre es muy amable con todos. Un ejemplo de profesora.'),
(16758, 'Suele dar clases de forma muy cuadrada y monótona. Su forma de evaluación no es clara y muy cambiante. sus prácticas no están bien organizadas y no sabemos una fecha exacta de cuando se realizaran, cambian mucho.'),
(16759, 'Es buena pero necesita más organización al momento de revisar los trabajos y en como deja sus actividades'),
(16759, 'Muy buenas clases'),
(16759, 'Maestra que empatiza con todos sus alumnos y busca que aprendan y se desenvuelvan bien en la vida.'),
(16760, 'No es justa y no hay recuperación'),
(16760, 'Aunque ya se sobre esta materia, me gusta su manera de explicar'),
(16760, 'Una profesora que realmente ama lo que hace, estaría bien que hiciera más ejercicios de speaking,  ya que a algunos se nos complica más hablarle que leerlo o escribirlo.'),
(16760, 'Calidad de profesora, explica muy bien los temas, siempre se aprende muchísimo en sus clases.'),
(16760, 'Muy buena profesora'),
(16760, 'Maestra que busca opciones para el desarrollo de sus alumnos.'),
(16761, 'Es comprensible'),
(16761, 'Todo bienn'),
(16761, 'Podría mejorar sus clases siendo prácticas.'),
(16761, 'Si sabe de los temas pero como consejo seria buscar una manera de como plasmar esa información en los alumnos'),
(16762, 'Presiona mucho pero está bien, mantiene a uno estudiando'),
(16762, 'Excelente maestra, la verdad pensé que con su carácter me haría sentir que no porque no sepa de su tema me haría menos, al contrario es una maestra que da los temas tan apasionados que me motivan a querer aprender más de ella'),
(16762, 'Aprendo mucho con su manera de enseñarnos'),
(16762, 'Como docente es muy buena pero al enseñar tiene muchos defectos ya que hace preguntas sin que nos pateos los alumnos sepamos el tema, al igual que no da retroalimentación o si las da no ayuda a pasar sus archivos o diapositivas en donde se apoyó a explicarnos y por lo tanto para nosotros se nos hace difícil a parte de ser una materia un poco pesada.'),
(16762, 'Una profesora muy buena, solo que a a veces faltaba más explicación de su parte o días de asesoría.'),
(16762, 'Muy buena profesora.'),
(16762, 'Muy profesional'),
(16762, 'Una maestra con mucho gusto por lo que hace,'),
(16762, 'Muy buena profesora, te desglosa fácilmente los temas y te refuerza la información.'),
(16763, 'Excelente profesor, da la clase con mucha pasión y en particular siento que eso me motiva mucho para aprender, aunque aveces no entienda busca la posibilidad para entender un tema'),
(16763, '¡¡Un buen profesor!!'),
(16763, 'En general, me gustan las clases de este maestro y es bueno, me agrada'),
(16763, 'Muy buen desempeño a la hora de dar sus clases, simplemente lo que mejoraría en su enseñanza es que al explicar lo haga con tiempo, no a las carreras ya que por mi parte no se me hace fácil tomar nota y prestar atención al mismo tiempo.'),
(16763, 'Estaría bien que se programaran más asesorías sobre los temas. Pero realmente, un gran profesor!!'),
(16763, 'Excelente'),
(16763, 'Un excelente profesor, muy dedicado a su trabajo, siempre hace que aprender sea más divertido y enseña los temas muy muy muy bien.'),
(16763, 'Muy buen profe.'),
(16763, 'El profe es muy buena onda!!'),
(16763, 'Muy buen profesor'),
(16763, 'Excelente docente !'),
(16763, 'Un excelente maestro ya que motiva demasiado y nos plantea distintas alternativas para aprender.'),
(16763, 'Muy buen profesor y facilita el aprendizaje.'),
(16764, 'Es una muy buena maestra,enseña muy bien y hace que nos esforzamos para que aprendamos,y eh aprendido mucho sobre su materia!'),
(16764, 'Me agradan mucho sus clases es dinámica mete presión y es entendible'),
(16764, 'Explica muy bien, en caso de no entender algo, ella responde a las dudas, es clara y da ejemplos para mostrarnos.'),
(16764, 'Es una maestra excelente'),
(16764, 'Excelente maestra, muy divertida y me encanta los juegos que hacemos para aprender'),
(16764, 'Muy buena maestra pero siento que se nos hizo pesado porque vimos mucha información en poco tiempo,sobre los músculos y son un poco difíciles de aprender,pero el rendimiento de la profa es muy eficiente porque hacemos muchas actividades que nos ayudan a concentrarnos en los temas y aprender más,deseamos tener materias más adelante con la misma profesora.'),
(16764, 'Muy buena maestra, explica y da muy bien sus clases y actividades para aprender más'),
(16765, 'Es un buen docente y entender y comprendes es fácil este cuatrimestre a implementado actividades dinámicas y eso a mejorado la calidad para aprender'),
(16765, 'Es muy buen maestro,siempre trata que los alumnos se esfuerze para aprender y se aprende mucho en la forma que explica y da sus clase!'),
(16765, 'Enseña muy bien, responde a las dudas y segunda explicación si no quedo claro algo.'),
(16765, 'Es buen maestro'),
(16765, 'Le da preferencia a algunos alumnos, incluso en los exámenes, aveces se comporta de una manera no adecuada para un docente.'),
(16765, 'Es un buen maestro,se nota que sabe mucho sobre los temas,nos explica con actividades proactivas dónde participamos todos y así aprendemos más,es puntual y buen maestro,esperamos que nos siga dando clases en siguientes materias'),
(16765, 'Es un exelente profesor'),
(16766, 'Ella misma se confunde y no te permite corregirla todos tenemos errores ella lo comenta pero ella no lo aplica'),
(16766, 'Es muy buena maestra,y muy simpática siempre le gusta que el alumno se siente libre de expresar su opinión'),
(16766, 'Enseña bien, pero en la manera en que los representa no son buenos.'),
(16766, 'Es buena maestra'),
(16766, 'Es buena maestra,enseña bien los temas que tenemos que ver,pero al momento de calificar no sabemos que califica o como lo califica,pero es buena maestra.'),
(16767, 'No se le entiende a su inglés no se le entiende a él y la verdad todos se salen de su clase espero y pasen a revisar su clase 10 de 31 alumnos'),
(16767, 'Es un buen maestro,pero le hace falta un poco más de hacer que el alumno entienda la forma en que habla el inglés, pero con las dinámicas que hace se aprende un poco más!'),
(16767, 'Explica los temas y da ejemplos, pero algunos ejemplos no son muy entendibles.'),
(16767, 'Excelente maestro'),
(16767, 'No se le entiende a su ingles, y repetimos 2 veces un examen por que pensó que no habíamos hecho el examen, no nos califica de acuerdo al porcentaje que dio al inicio, nos llama \"generación de cristal\", no nos toma en cuenta las tareas, y cuando tenemos todos nos da una calificación baja'),
(16767, 'La manera de calificar es deficiente porque no sabemos que califica y no dijo al principio del cuatrimestre en que se basaría para la calificación.'),
(16768, 'Creo faltó el no aplica puesto que ella solo nos dió un parcial pero ese parcial que nos dió fue increíble entendible y súper divertido'),
(16768, 'Era muy buena maestra,explicaba muy bien y era muy buena dando los temas sobre su carrera,se expresaba muy bien y eso hacia que entendiera mejor!'),
(16768, 'Su manera de enseñar es muy buena, y en caso de entender mal algo, ella nos corrige.'),
(16768, 'Es buena maestra'),
(16769, 'Es un docente exelente en el área estudiante comprendes y aprendes lo necesario pero no es tolerante con los alumnos kinestesicos y bueno también he a prendido a trabajar conmigo para no causarle molestias en su clase a ella'),
(16769, 'Es una buena maestra y enseña muy bien,eh aprendido mucho sobre las materia que da!'),
(16769, 'Su forma de explicar es muy buena, y las actividades que realizamos con ella nos ayuda para comprender los temas'),
(16769, 'Es una maestra excelente'),
(16769, 'Excelente maestra, para todo tiene respuesta y explica muy bien'),
(16769, 'Una maestra excelente, muy divertida, explica bastante bien y me gusta sus diversas formas de enseñar, tanto con presentaciones como juegos'),
(16769, 'Buena maestra y nos dió claramente los métodos de calificación y lo que valía cada actividad'),
(16769, 'Exelente profesora'),
(16769, 'Excelente profesora explica muy bien y sus clases son didácticas'),
(16769, 'Es una maestra muy buen qué explica bien los temas y nos resuelve dudas'),
(16770, 'Es un profesor exelente en el área del aprendizaje, que cumplír con sus horarios suele ser aveces complicando para el pero siempre se aprende y se adquiere conocimiento te exige más de los que llevar para superarte y promueve el impulso de aprender para desarrollarte en el área laboral'),
(16770, 'Es un buen maestro,enseña muy bien y motiva aprender más de la carrera y de igual manera hace que el alumno se esfuerze y  aprenda de si mismo (sobre sus capacidades) y es un maestro que le gusta platicar y así mismo el alumno se le queda grabado las asignaturas o temas que vemos sobre la carrera'),
(16770, 'Es muy buen maestro, responde a las dudas.'),
(16770, 'Es un excelente maestro'),
(16770, 'Es muy buen maestro, explica muy bien y he aprendido demasiado gracias a él y su forma de enseñar'),
(16770, 'Es un buen profesor'),
(16771, 'Un muy buen profesor'),
(16771, 'Todo genial, enseña muy bien'),
(16771, 'Nada que decir Más que es un gran maestro en toda la extensión de la palabra.'),
(16771, 'Buen profe, hace diversas formas de examen ya sean escritos o orales'),
(16772, 'Excelente profe'),
(16772, 'enseña bien, pero se me dificulta un poco está materia'),
(16772, 'Es un maestro muy inteligente y excelente maestro en toda la extensión de la palabra.'),
(16772, 'Es un buen profe y explica bien los temas al igual trae buen contenido y no aburre su clase'),
(16773, 'Si aceptará las opiniones de los demás y no fuera tan cerrada en cuanto a lo que ella \"sabe\" y no estuviera siempre a la defensiva, quizá sería buena profesora.'),
(16773, 'Bueno'),
(16773, 'todo bien'),
(16773, 'Es una maestra muy noble, amable, siempre está atenta a todo con la asignatura y entrega todo de sí.'),
(16774, 'Si explicara en español sería mucho mejor.'),
(16774, 'Buena maestra'),
(16774, 'Muy buena maestra ?'),
(16774, 'Sus clases de la maestra son las mejores, explica y te ayuda a aprender muy bien el ingles'),
(16774, 'Es una gran maestra, de igual manera');
INSERT INTO `Curso_comentario` (`id_curso`, `comentario`) VALUES
(16775, 'Evaluo a la profesora basándome en solo a las dos unidades que nos dio clases puesto que no cursamos toda la materia.'),
(16775, 'No tuvimos clases a lo largo del cuatrimestre'),
(16775, 'No logramos completar el cuatri con esta maestra'),
(16775, 'El poco tiempo que estuvo con nosotros , fue una exelente profesora, era muy dinámica y la verdad aprendíamos muy bien \nY cumplía con todo el cuestionario , solo que por compromisos mayores ya no pudo estar en el cuatri .'),
(16775, 'Casi no tuvimos clases con ella'),
(16775, 'Solo tuvimos 2 parciales con la maestra pero era buena explicando los temas'),
(16775, 'Era buena maestra pero se fue'),
(16776, 'Buena maestra que no muchas personas valoran!!'),
(16776, 'Muy buena maestra'),
(16776, 'Todo bien'),
(16776, 'Las clases de la maestra son muy buenas, explica muy bien y claro'),
(16776, 'Muy bueno, es una gran maestra muy inteligente, siempre está apoyándonos en todo lo que necesitamos personal y escolar, nos ayuda para poder pasar su materia de todas las formas. En pocas palabras es una gran maestra'),
(16776, 'Es muy buena la profa pero se extiende demasiado, auque el error es mio por no estudiar y estar al pendiente'),
(16777, 'De una manera excelente cumple con todos los criterios'),
(16777, 'Muy buena maestra, es mu comprensible en muchos ámbitos, siempre da lo mejor de ella en sus clases e intenta que nosotros los alumnos podamos comprender'),
(16777, 'genial'),
(16777, 'La maestra es muy buena explicando los temas vistos durante el cuatrimestre, solo seria mejor si hiciera sus clases mas dinamicas'),
(16777, 'Es una gran maestra, enseña muy bien, la manera en que trata de ayudarnos es buena, siempre quiere que aprendamos más, cosas nuevas cada día y siempre nos está apoyando en todo lo que necesitamos.'),
(16777, 'Me gustan sus clases las hace ver que son cencillas de aprender, pero tal vez si fueran más didácticas o proyectos más gráficos'),
(16777, 'Excelente profa la verdad, los temas los deja claro y no se adentra en el sentido de muchas palabras, lo explica breve y muy bien'),
(16778, 'Es la mejor de todas la profesora, amplia capacidad de enseñanza, muy comprometida'),
(16778, 'Cuando existen compañeros que por ejemplo, se van de su clase o demás, comienza a regañarnos a nosotros que si nos quedamos a clase, y quejarse una y otra vez, es decir, considero que si existen alumnos que son groseros o que no asisten a su clase, no tiene porque desquitarse con los que si asistimos a su clase, e incluso llega a ser grosera y prepotente al momento de hacer algun comentario ya sea para corregir o para retroalimentar'),
