(16784, 'Es una profesora con muy mala actitud y que proporciona mala información'),
(16784, 'Me gustaría que sus fuentes fueran actualizadas.\nQue impartiera la asignatura de forma correcta y no buscara las diapositivas en internet.\nQue las respuestas que le de a un alumno no sean diferentes a las de otro alumno por la misma pregunta.'),
(16784, 'Una profesora que no debería de impartir la docencia, sus diapositivas son sacadas de internet además de que algunas tiene mal la información y no se da cuenta, pone a sus creencias por delante de él respeto hacia los demás diciéndonos que no podemos decir “compañere” o “amigue” ya que ella no cree en eso y si lo decimos nos saca de las clases; toma las quejas de manera muy muy personal y no de la manera profesional ya que una vez se quejaron de las diapositivas y se puso muy hostil desde que se enteró quienes fueron. Se queja mucho de los otros grupos diciendo que son terribles y nos dice que somos el peor grupo qué hay en la carrera y que todos los maestros opinan igual. En sus clases dice que no se le puede “tocar” y que aunque nos quejemos sus 5 o más años de docencia la respaldan dando a entender que aunque le digamos a los directivos en lo que está mal no le harán nada por su tiempo estando en la universidad. No aprendo nada de sus clases aunque preste atención. Se la pasa regañando al grupo en general. Cuando el coordinador Felipe fue a evaluar una clase se comportó como una persona diferente y cuando el coordinador se fue empezó a decirnos cosas diciendo que todos estábamos mal. Nada profesional y no imparte buena docencia.'),
(16784, 'Me gustaría que pusiera un poco más de empeño a la hora de impartir clases'),
(16784, 'En ocasiones la profesora en lugar de motivar a seguir aprendiendo lo que hace es desmotivar ya que dice algunas cosas que vuelven algo incomoda la clase, es deficiente en el aspecto de sus diapositivas puesto que son sacadas de internet así como de diversas paginas y no usa una bibliografía concreta. En algunos momentos llega de mal humor y eso afecta ya que se desquita de alguna u otra manera, llega tarde a la hora de aplicar los exámenes para evaluarnos aparte de llegar tarde nos regaña diciendo que no perdamos tiempo.'),
(16784, 'Existen muchas inconsistencias en cuanto a sus formas de calificar, y de dar sus temas, no hay un orde, ni rubricas, ni nada que nos guie, los temas que nos da , muchas veces lo hace de manera incompleta puesto que las fehcas de evalaciones \"nos alcanzan\" y aun asi ella evalua esos temas aunque no los haya dado'),
(16784, 'La maestra llega tarde a las clases, especialmente en los exámenes. Su material de apoyo, son presentaciones bajadas de internet de hace 10 años, se justifica diciendo que sacó del libro la información. Incluso las diapositivas han estado en portugués. No da rúbricas cuando evalúa. Siempre cambia las fechas de entrega de proyecto o examen ya que nos atrasamos viendo los temas. Tarda mucho en calificar los exámenes y en entregar las calificaciones.Cuando califica los exámenes, lo hace mal, ya que hemos visto con compañeros que escribimos la misma respuesta y a uno le pone tacha y a otro se la pone con palomita.'),
(16784, 'Es buena profesora, pero en muchas ocasiones es grosera, no brinda buena información y no aclara dudas en la mayoría de las ocasiones, ya que siempre nos dice que debemos saber o que lo busquemos por nuestra propia cuenta\nSe demora mucho para brindarnos las calificaciones, nos recorre mucho las fechas de examen y no nos brinda su método de calificación'),
