(16798, 'Es una gran profesora, explica de una manera en la que cualquiera le puede entender. Como toda personas, tiene sus pro y contra. Se toma muy personal las cosas y cuando está molesta, no responde dudas o contesta de mal forma. Nos pone a competir y no digo que esté mal, sino que luego dice lo contrario, que lo que no quiere es que compitamos lo cual, es imposible.'),
