(16799, 'Es muy buena maestra, enseña bien los temas, lo único que es un poco malo es su actitud grosera con los de seguridad o algún otro empleado de la universidad.'),
(16800, 'Es una maestra muy prepotente hace llorar a sus alumnos y los humilla en clases si estos tienen alguna duda, humilla de forma muy brusca y delante de todo el salón, no tiene tacto para enseñar y corregir de una forma decente, siempre grita y regaña a los alumnos aveces sin motivo alguno. Muy mala profesora'),
(16800, 'Sería bueno que aprendiera a retro alimentar sin la necesidad de exhibirnos de una forma poco respetuosa, manejar el tacto.'),
(16800, 'La maestra es muy mala enseñando en el aspecto de que no tiene tolerancia a sus alumnos, humilla y los hace sentir mal al punto de llorar, en mi caso me a echo sentir muy mal ya que cuando me equivoco solo me regaña muy feo enfrente de todos, pero hay ciertos compañeros que se equivocan y los corrige de manera más pacífica, eso se me hace muy injusto.\nEn conclusión la maestra Regina ya no debería de dar clases, por que nos hace sentir mal a la mayoría por su forma de enseñar a base de regaños, humillaciones, etc.\nSinceramente si la profesora nos llega a tocar en el siguiente cuatrimestre no la tomaré con ella, no importa si tengo que tomar la materia en la tarde. \nGracias.'),
(16800, 'No es empática y te grita si no sabes algo, ojito ahí'),
(16800, 'Debería mejorar la forma en que da retroalimentación y tener más tacto al hablar con los alumnos'),
