(16800, 'Mejorar su conducta y sistema de calificación'),
(16800, 'La profesora imparte bien el contenido de clase pero es poco tolerante a los comentarios o retroalimentación. Suele ser poco tolerante con los errores y un poco grosera en las correcciones. Tiende a exponer a las personas cuando cometen errores.'),
(16800, 'Es una excelente maestra pero al momento de irle a preguntar algo no lo hace de la manera correcta'),
(16800, 'Solo pediría que en su comportamiento sea mas respetuosa,que tenga un poco mas de paciencia hacia sus alumnos, no todo lo sabemos para eso estamos aquí para aprenderlo y no lo hacemos perfecto.\nMejore su forma de trato por que siempre he dicho que así como quiero que me traten, trato también yo a las personas:('),
