(16809, 'Siempre da las clases de manera positiva, nos motiva y nos orienta sobre temas donde estamos deficientes, nos pregunta sobre si tenemos alguna duda, excelente profesora!'),
(16809, 'Una excelente maestra, te brinda muchísima información para comprender mejor el tema'),
(16809, 'Las clases son muy buenas, sin embargo me gustaría que profundice más los temas para un entendimiento real del funcionamiento.'),
(16809, 'Me encanta su clase'),
(16809, 'Excelente profa ?'),
(16810, 'Estricto , motivación y exelente maestro espero y me vuelva dar clases en terapia en quemados, apuntados o otrotesis.'),
(16810, 'Un excelente profesor, nos apoya en cosas que no tengan nada que ver con la asignatura y se nota que le gusta enseñar, muy buen profesor'),
(16810, 'Muy buen maestro'),
(16811, 'Muy buen profe, siempre hace su clase más dinámica.'),
(16811, 'Excelente profesor, hizo que la materia sea interesante y cada técnica que vimos, supo adaptarla de forma precisa y didácticas, en casa clase'),
(16812, 'Una maestra como ninguna, tanto como tutora su desempeño es magnífico todas sus clases son muy interesantes nunca te deja con dudas y explica de una forma tan agradable una maestra demasiado capaz y sobre todo con un gran talento a la enseñanza, motiva a sus alumnos y en cualquier asunto siempre está para apoyarnos.'),
(16812, 'Excelente maestra y tutora'),
(16812, 'Desde la primera vez que me impartió clase fue excelente, es una lástima que este cuatri nos haya dado tan pocas horas, aprendo demasiado con ella, la profesora más preparada'),
(16812, 'Muchas felicidades profesora, la verdad me gusta mucho como da la clase y es muy entendible'),
(16812, 'Es la mejor maestra'),
(16812, 'Mejorar su sistema de calificación'),
(16812, 'Excelente clase, pero muy pocas horas a la semana. Se necesita más horas en clase.'),
(16812, 'La mejoooooooor ❤️\nLe dan muy pocas horas, solo 3 horas le dieron este cuatri, merece 6 horas'),
(16812, 'Deberían de darle más horas de clase ya que está materia tiene mucho contenido'),
(16813, 'Me gusta como da las clases pero sus exámenes aún me dan miedo y espero verlo en el próximo cuatrimestre en docencia o prótesis ??'),
(16813, 'Hay cosas que no explica bien, que hasta el mismo se confunde, y peor aún, nos confunde a nosotros y al evaluar si te equivocas en algo te pone 0 en lugar de un 7 u 8'),
(16814, 'me gusta que siempre combina lo teórico con lo práctico y hace q participemos.'),
(16814, 'Excelente clases'),
(16814, 'Excelente maestra, su conocimiento en la materia es demasiado concreto y la forma practica, nos genero una mejor captación de información'),
(16815, 'La profesora más noble y magnífica enseña muy bien, tiene un gran talento para enseñar, siempre da consejos de su materia y aclara cualquier duda que tengamos. Más profesoras cómo ella'),
(16815, 'Muy buena maestra, te hace reflexionar'),
(16815, 'Se contradice mucho en el momento de marcar actividades, las cambia a última hora'),
(16815, 'Debe planificar mejor sus clases, siempre se contradice'),
(16815, 'Buena profa'),
(16815, 'Es una excelente maestra pero le hace falta planeación y orden para dar sus clases'),
(16816, 'Es muy buena maestra, aún que le falta precticas, me gusta la forma de darnos clase .'),
(16817, 'Muy buena profa, me gusta que siempre combina lo teórico con lo práctico.'),
(16817, 'Exelente clases brindadas'),
(16817, 'Sin nada que anexar'),
(16817, 'Es una excelente maestra, desempeña el conocimiento de todos las diferentes técnicas que se presentaron a largo del cuatri, de igual forma es empática y simpátiza con los alumnos:3'),
(16817, 'Es una excelente maestra que hace las cosas muy prácticas'),
(16817, 'Es buena profesora y se nota que sabe mucho. El detalle es que, se enoja muy rápido o se desespera muy rápido . Comprendo como profesora puede dar las órdenes y que se espere que entendamos porque somos adultos pero se enoja feito (no lo demuestra tanto, pero sus facciones la delatan) y me hace sentir mal.'),
(16817, 'Es buena maestra, pero por momentos muestra cierta preferencia por otros alumnos y hace marcada la diferencia entre cada grupo de alumnos dejándoles buenas cosas a ellos, ignorando por completo a los demás o no mostrándoles interés.'),
(16818, 'Una profesora muy excelente abarca todos sus temas te motiva a seguir y aclara dudas. Siempre dispuesta a apoyar a sus alumnos'),
(16818, 'Excelente'),
(16818, 'Excelente profesora ☺️'),
(16818, 'Es una excelente profesora, empatiza mucho con nosotros y nos mantiene al día con nueva información, nos comparte su amor por su carrera y eso se nota en las clases \nLa mejor ❤️'),
(16818, 'La profesora sabe explicar exelente'),
(16818, 'Primera vez que me da clases. Excelente profesora'),
(16818, 'Es interesantes sus clases, siempre se aprende algo nuevo e interactivo'),
(16818, 'Excelente profesora, siempre motivandonos para seguir aprendiendo, usa analogías de la vida diaria, fomenta el respeto y disciplina.'),
(16818, 'Ninguno'),
(16819, 'Muy buena maestra espero y me vuelva dar clases'),
(16819, 'Una excelente profesora'),
(16819, 'Muuuuyyy buena maestra, muy paciente y muy risueña'),
(16819, 'Muy buena maestra'),
(16820, 'Es una maestra estricta, no se le puede negar que le gusta enseñar la clase, lo único malo es que aveces tira indirectas pero las hace al aire, hace comentarios un poco fuera de lugar pero nunca ofende, nada alejado de la realidad solo que no debería de tirar indirectas en algunas ocasiones, le gusta su materia, le gusta enseñar, no da asesoría pero si recomienda métodos de estudios buenos, gracias a ella he aprendido a pronunciar un poco mejor el inglés, si pudiera la pediría para el siguiente cuatrimestre pues es la indicada para enseñar, no tiene intenciones de humillar a sus alumnos pues nos ayuda a la pronunciación del inglés, cómo profesora de inglés es excelente'),
(16820, 'Sinceramente nunca había tenido una maestra tan grosera, nosotros tenemos 10 min. De tolerancia para llegar y si llegas 5 min. Tarde no te deja pasar, te exibe delante de todos, te humilla a pesar de que intentes hacer lo que dice, en una ocasión no pude abrir mi plataforma y le comente, me dijo que ese no era su problema y me reprobo en esa unidad y ya no qioso abrirme las demás plataformas, es una mala maestra a mi parecer que oiensa que todos estamos a su nivel'),
(16820, 'Los únicos puntos en contra de esta maestra son que sus clase tienden a volverse un poco aburridas y que hay ciertos momentos donde se vuelve un poco más estricta de lo que debería ser. Aun así enseña bien la maestra.'),
(16820, 'Es buena maestra de ingles en general es con la que mas eh aprendido ingles pero, algo que no ke gusto es que la maestra no tiene ponderacion a la hora de calificación ella solo te aprueba si ya sabes ingles, premia a los que ya saben el idioma y aunque te esfuerces puedes tener todo bien en el examen del libro y la plataforma y actividades de clase pero si en el examen oral ve uqe no sabes el idioma, lo cual pasa mucho, simplemente no puedes acreditar su materia y no puedes alegar por que ella solo te dice que la calificación de aprobar o no, lo deja su criterio no a cuanto sacaste en realidad de calificación en libreta o la llataforma del libro y no me parece justo eso.'),
(16820, 'No le agradó y no me agrada'),
(16820, 'Explica bien pero no me gusta'),
(16820, 'Con esta maestra tengo la materia exentada, SIN EMBARGO, se me hace una tontería que ni siquiera me deje estar en el salón, no me ha echado por hacer relajo o distraer a mis compañeros, no ha habido llamadas de atención, siquiera me ha dado la oportunidad de estar en el salón. Se me hace tonto que me echen o que si llego temprano para mi siguiente clase no me deje pasar en lo absoluto. Y sin acusar a nadie pero mis compañeros tampoco hablan bien de este docente'),
(16820, 'Admito que es la única profesora con la que logramos ver hasta 5 unidades, pero no me gusta mucho como da la clase, a pesar de avanzar rápido, se sienten sus clases muy tediosas y aburridas'),
(16820, 'Considero que enseña bien pero tiene una mala manera de calificar por lo que nos afecta en las calificaciones, una vez le entregue un justificante y me dijo que sí justificaba la falta pero aun así me bajó puntos por no asistir, de igual manera baja puntos por tu forma de ser'),
(16820, 'Excelente'),
(16820, 'Es muy mala maestra :)'),
(16821, 'Le falta mucha experiencia como docente y paciencia'),
(16821, 'Tiene preferencia con una alumna y le paso respuestas del examen delante de todos, le ayuda siempre y cuando nosotros le preguntamos no nos hace caso, ya ese maestro ya nadie lo quiere en el salón es el peor maestro que he tenido, ojalá se pueda hacer algo al respecto'),
(16821, 'Realmente me causa cierta molestia y frustración la manera en que el Ing. Aldair ha llevado su clase. Tengo cierto conflicto porque en el primer parcial de este cuatrimestre el profesor había llevado una buena clase, incluso pudimos ir a apoyarlo en ciertas actividades en el hospital general, y yo, que fui de los pocos que pudo ir, tuve oportunidad de aprender bastante, pero su clase no es perfecta y lo que más destaco como algo negativo en su manera de calificar, es su necesidad de requerir de puntos de participación ya que sin ellos no puedes presentar examen y esos puntos estarían bien si también fueran algo justo para todos y te apoyen de cierta manera en la calificación, pero no lo son ya que luego hace preguntas durante la clase de cosas que no hemos visto y se llega a perder ese punto, lo cual, es bastante estresante porque no sabes realmente cuando te tocará responder una pregunta y si tienes suerte de que te pregunte algo fácil pues ya la libraste, pero hubo muchos compañeros que no la tuvieron. Siento que es una mala manera de calificar ya que no todos son unas personas que entienden a la primera un tema nuevo y les terminan perjudicando. También el profesor tiende a no dar una buena retroalimentación en los trabajos y más que hacerte ver por dónde estás mal, puede hacer que te sientas un poco ¨humillado¨. Otro tema es que yo entiendo que puede ser la primera vez que da clases, pero realmente vi una mala organización de su parte con respecto a los temas que debemos llevar y aun cuando nos dice que vamos atrasados con algunos temas, prefiere regresarse a explicar temas que se vieron en la unidad pasada. Otro punto negativo es que tiende a dar comentarios rápidos de ciertas cosas que no te imaginas que sean muy relevantes, pero luego salen en examen por lo que tampoco tiene bien establecido la profundidad de ciertos temas. Además se notó una preferencia de apoyar bastante a ciertas compañeras, en cuanto a sus calificaciones y apoyos para pasar las unidades. Dando todos estos puntos se tuvo ciertas pláticas con el profesor y la coordinadora de la carrera de las cuales no se tuvo una buena recepción de estos comentarios por parte del profesor, lo que desembocó en un trabajo ridículamente largo para el poco tiempo que dio, clases con una mayor tensión y cierto rechazo del profesor por dar una buena clase, por lo que siento que no he llevado un buen aprendizaje de ni siquiera las bases de los temas y me parece ciertamente triste que alguien que debe ser un profesional haya tomado acciones consideradas infantiles. Ojalá mejore bastante en caso de que vaya a seguir de docente, pero definitivamente por ahora no es una buena clase.'),
(16821, 'Es primera vez que es docente y si dejo mucho que desear, llegaba tarde, no podias tener dudas, era vengativo con el alumnado, no tenia ponderacion marcada, abiertamente me dijo que por carle mal me puso menos calificación que mi compañera de mi mismo equipo, pasabamos a exponer y tiempo despues te decia por que no expusiste y solo te ponia de calificación lo que el creia cambio a un docente de la institucion a medio cuatrimestre sin razon aparente que nos haya esternado el, los demas docente se enojaban por que no nos dejaba salir del salon y se tomaba tiempo del siente profesor, tiene preferencias por alumnos en especifico, en fin no creo que nos haya hecho un bien por diferentes puntos marcados que hizo a lo largo del cuatrimestre'),
(16821, 'Que JAMÁS nos vuelva a dar clases'),
(16821, 'No tan buena clase no se expresa bien'),
(16821, 'Ha hecho un mal trabajo como maestro, trata de mala manera a compañeros a tal punto de lanzarles carpetas, deja actividades sin sentido y ni si quiera nos dice cuánto valen o nos da lista de cotejo, no tiene clases preparadas, no nos brinda diapositivas ni material didáctico.'),
(16821, 'Tuvimos muchos problemas con este profesor. (Lo puse en el apartado de Aldair Canseco, una disculpa, todo comentario que hice en el apartado de Aldair Canseco era para este profesor)'),
(16821, 'Muy buen profesionista, pero mal profesor, desde la filosofía que tiene respecto al alumno-universidad. tiene buenas intenciones, prácticas, cosas que se ven en la vida real, sin embargo está todo muy mal ejecutado y con una pobre planificación, se siente como si todo se le ocurriera en él último momento, en lo personal me agrada como persona y es muy buen ingeniero de campo, sin embargo es demasiado exigente (parcialmente injusto) y es muy difícil siquiera obtener una calificación decente. Repito ,buena persona y profesionista pero malo pedagógicamente, con buenas intenciones y buenos temas, pero explicados de una forma rara e inestable, ejecutados de mala manera.'),
(16821, 'Me sorprende que en el primer parcial se desempeño bien, pero después ya no, muy pésimo seguimiento de temas, desorganizado, parece que se le olvida que es cuatrimestre, también intento dar clases de Ing. clínica por la fuerza, sin una confirmación oficial de parte de la coordinación, mientras que nuestro profe de Ing. clínica no estaba al tanto de la situación. No me gustaría que nos diera más clases en materias posteriores de ing. biomédica'),
(16821, 'Excelente'),
(16822, 'Es un maestro un poquito despistado, no enseña mal, enseña bien pero aveces se hace bolas, es un maestro comprometido a la termodinámica y es capaz de enseñar o ayudarnos a entender mejor la materia de termodinámica con sus dispositivas y luego sus explicaciones, lo que aveces es complicado es que el examen vale el 100% pero hasta eso el no es malo con su examen pues nos deja ejercicios y preguntas en lo más justo posible'),
(16822, 'Me gusta como da la clase pero su examen vale el 100 porciento y pues es mucho para nosotros en ciertas ocasiones'),
(16822, 'Me agrada su clase y en general enseña bien, solo que si no entiendes bien un tema tendrás que esforzarte bastante para alcanzarlo y también hay ciertas partes de ciertos temas que pueden quedar un poco confusos y puede equivocarse a la hora de resolver un problema, pero se suele dar cuenta y rectifica la información. Aún asi los temas son interesantes y se entiende de lo que habla.'),
(16822, 'Muy buen profesor'),
(16822, 'Muy buena clase'),
(16822, 'Profesor a mi parecer decente, se preocupa por la materia aunque tampoco mucho por los estudiantes, es verdad que para ser una materia tan compleja el hecho de que solo sean 3h a la semana complica bastante el método de aprendizaje ya que es mucho contenido en poco tiempo, más allá de eso no hay mucho que decir'),
(16822, 'Bien'),
(16822, 'Excelente'),
(16822, 'Me disgusta que el examen vale el 100%'),
(16823, 'Es un maestro que esta dedicado a su asignatura que es la anatomía, nos ayudó al momento de sus exposiciones y nos corrigió para mejorar, nos retroalimenta con sus consejos y no es alguien que esté dispuesto a ignorar a sus alumnos, su método de enseñanza es eficiente y comparte sus conocimientos con nosotros, es el maestro que esta dispuesto a guiar y forjar a un buen estudiante'),
(16823, 'Me encanta la manera de enseñar porque tiene muchos métodos de aprendizaje, es una  pena que solo nos quede poco tiempo con el'),
(16823, 'Muy buen docente, a pesar de que su clase está cargada de información, nos supo guiar por lo más importante y siento que pude aprender y mantener interesado por los temas. Se sufrió un poco con él por las tareas y carpeta que se debía llevar, pero fue un buen recurso para estudiar.'),
(16823, 'Muy buen profesor'),
(16823, 'Excelente su clase muy bien explicada'),
(16823, 'Muy buen profesor, con buena actitud y un interés en materia y alumnado'),
(16823, 'Al ser una materia muy relacionada al cuerpo humano ser mucho mas interactiva de lo que ya es'),
(16823, 'A pesar de ser una materia con un sin fin de conceptos y temas, gracias a su bibliografía, nos pudimos apoyar de forma gratificante durante los temas que impartía'),
(16823, 'Excelente'),
(16824, 'Es un buen maestro, a veces es acelerado al momento de explicar las clases, pero eso no quita que no resuelva tus dudas, se le entiende a lo que explica, es tolerante con sus alumnos y mantiene el papel de maestro ejemplar, pese a que aveces algunas compañeros no toman enserio su clase eso no quita que el no quiera dar la clase con entusiasmo'),
(16824, 'Mi asignatura favorita donde aprendes y te diviertes, ese maestro me ayudo mucho a aprender a participar, nunca te dice que estas mal solo que puedes mejorar, personalmente no platica mucho pero unl entiende que tal vez sea para que no haya malos entendidos quizá'),
(16824, 'Excelente profesor, aun cuando muchos no se llegan a tomar muy en serio la clase, creo que ha servido de algo y lo que he aprendido también me ayuda a ser no solo un buen profesional, si no una mejor persona. También sé que puedo contar con su apoyo.'),
(16824, 'Muy buen profesor'),
(16824, 'Que no nos vuelva a dar clases JAMÁS:)'),
(16824, 'Buena clase y entretenida'),
(16824, 'Tuvimos muchos problemas con el (hablo por todo mi grupo). Y personalmente, podrá ser buen Ing (no lo conozco), pero es un mal profesor. Ojalá consideren todo comentario.'),
(16824, 'No son necesarias las asesorías ya que no me parece una materia complicada, muy buen profesor en general'),
(16824, 'Explica bien los temas, buen conocimiento de los mismos hace que hable con soltura comodidad'),
(16824, 'Excelente'),
(16825, 'Un maestro que apesar de ser nuevo mantiene la paciencia en la enseñanza, responde y procura resolver las dudas de sus alumnos, presenta diapositivas con explicaciones detalles y mediante esas bases nos enseña, es un maestro carismático y comprometido con su clase. Es una pena que nos lo hayan quitado y nos hayan puesto al maestro aldair canul como maestro de ingeniería clínica, si está encuesta es leída pido de favor que nos regresen al maestro Adalberto y nos quiten al maestro canul como maestro de ingeniería clínica.'),
(16825, 'Siendo honesto no ha sido un mal profesor, el único problema que llego a encontrar es por la modalidad en línea que debe dar la materia, ya que es un poco difícil tener un seguimiento bueno de los temas, pero eso ya es más por parte personal, que no llego a estar toda la clase atento a lo que dice, aparte es complicado cuando toca una hora en la que estamos en la universidad porque el internet no llega a ser el mejor. Ojalá más adelante se tenga una buena oportunidad con él.'),
(16825, 'El profesor adalberto es el que mejor desempeño su trabajo como docente, en cambio cuendo nos hicieron cambio de profesor por aldair nunca nos enseño nada todo dedusia que ya lo debimos a ver visto con el otro maestro cuando no le constaba ni siquiera, nos puso a hacer los deberes de su otro trabajo el maestro aldair por constantes sesiones de clases, nos hizo sacar copias completar los folders incompletos de su otro trabajo, en general se hizo un cambio de docente de mala manera y sin razon aparentee ya que nosotros como grupo estabamos bastantes conformes con adalberto como docente y sin previo aviso a el lo cambiaron'),
(16825, 'Excelente maestro'),
(16825, 'Buena explicación y se entiende aunque sea en línea si sabe explicar'),
(16825, 'La explicación del ingeniero es buena lo único malo de las clases en línea es que el acceso a internet no es tan bueno y se corta la videollamada, si las clases fuesen de manera presencial entenderiamos bien de manera práctica'),
(16825, 'Tuvimos problemas (no por su parte) con el y con el profesor Aldair. Tuvimos clases en línea con el y no fue del todo malo, pero si hubiera sido presencial hubiera estado mejor.'),
(16825, 'Es muy difícil calificar a esta materia ya que es impartida en línea, es un muy buen profesor, le interesa tanto la materia como los estudiantes, ya que es de manera virtual se llegan a perder cosas cruciales al momento de aprender lo cual hace que no me guste demasiado, si fuera la clase presencial, estoy muy seguro de que sería una clase ideal'),
(16825, 'Aun que sea en linea, como el trabaja en este ambito, si nos aproxima a una realidad laboral de nuestra carrera :)'),
(16825, 'Excelente profesor'),
(16826, 'Sin duda alguna un excelente maestro, bueno en lo que enseña y paciente con sus alumnos, si pudiera lo pediría para el siguiente cuatrimestre'),
(16826, 'Que bueno es un buen maestro pero he tenido inconvenientes con el muy personales que no deberian de pasar'),
(16826, 'Es muy buena su clase, realmente me agrada mucho, aunque a veces tiende a no ser tan flexible con ciertas situaciones, pero aprendo muy bien con él. De los mejores docentes que ha dado clases este cuatrimestre'),
(16826, 'Excelente profesor'),
(16826, 'Bueno explicando cada tema'),
(16826, 'Explica muy bien los temas, además son entendibles'),
(16826, 'Muy buen profesor, dedicado a los alumnos y a la materia, en algunos casos especiales llega a ser bastante estricto y no suele acomodarse o ser empático a las situaciones extrapersonales que lleguen a afectar al rendimiento de su materia'),
(16826, 'Se toma el tiempo para explicar y ejemplos de cada tema nuevo'),
(16826, 'Buen profesor, explica muy bien los temas'),
(16826, 'Es un excelente profesor'),
(16826, 'Excelente'),
(16827, 'Duda que hay, duda que se resuelve, gracias a el aprendí todo lo que sea en electrónica.'),
(16827, 'Excelente docente, a mi consideración el mejor maestro de matemáticas.'),
(16827, 'Excelente profesor!!!!!'),
(16827, 'Excelente profesor'),
(16828, 'Brinda ejemplos de la vida cotidiana relacionados a la materia, te hace verlo de una forma natural algo que podría ser muy complicado, felicitaciones Ing Ramon.'),
(16828, 'Usa muchas diapositivas lo cual hace las clases tediosas aun cuando el tema sea interesante, me gustaría que nos animara más a participar o hacer prácticas para salir de la rutina y adquirir mejor los temas'),
(16828, 'Gran profe'),
(16828, 'Sabe explicar y contestar'),
(16829, 'Un gran docente que emplea mucho actividades relacionadas a lo que estamos viendo, de esta manera hace que el aprendizaje y temas sean más fáciles.'),
(16829, 'Realmente hace la clase dinámica y los temas se vuelven sencillos de adquirir, solo siento que hace falta un poco más de autoridad, aveces los alumnos no prestan atención, no lo dejan explicar y usan demasiadas groserías durante la clase'),
(16829, 'Bien'),
(16829, 'Excelente profesor'),
(16830, 'No tiene tanta paciencia con los alumnos'),
(16830, 'Le hace falta abrirse a escuchar diferentes puntos de vista, hace falta tacto al dirigirse a los alumnos'),
(16830, 'Es una profesora muy buena, explica muy bien los demás a seguir al igual que te dice en qué puedes mejorar,  pero tiene un carácter un poco fuerte'),
(16830, 'Excelente'),
(16830, 'sus actitudes son a veces muy malas'),
(16831, 'Nunca había entendido matemáticas, pero el profe Azael me motiva a seguir aprendiendo y he aprendido muchos métodos y tips que me facilitan la materia gracias a el.'),
(16831, 'Explica detalladamente y responde a lo que le.pregunto'),
(16831, 'realmente se empeña en que los alumnos entiendan lo que estan realizando brindando multiples instrucciones'),
(16832, 'Profesor que me dio una gran impresión al momento de enseñar, aprendo mucho con el, solo que uno que otro ejemplo más antes de poner un ejercicio estaría bien, pero fuera de eso me gustaría volver a tenerlo en más cursos próximamente.'),
(16832, 'No resuelve dudas, siempre contesta con otra pregunta o comenta que es algo que ya deberíamos saber. No da retroalimentación de las actividades o exámenes y aún no nos da calificación de ninguna unidad'),
(16832, 'No me gusta que a veces deja temas sin comprender o al momento de explicar te dice algo y después otra cosa'),
(16832, 'Sin comentarios'),
(16832, 'debería optar por tomar ejemplos al inició ze de la unidad, mencionar uso y funciones de llamadas unotros metodos de afrontar el problema'),
(16832, 'En ocasiones no entiendo su explicacion');
INSERT INTO `Curso_comentario` (`id_curso`, `comentario`) VALUES
(16833, 'Es un buen profe'),
