(16852, 'En cuestión de la profesora Maria Jose se desarrollo de una forma poco profesional en este cuatrimestre debido a que explico muy poco su materia encargo a un alumno llamado \"Mauricio Molina\" a dar una clase completa debido que \"Ella no tenia tiempo\". Nose si la profesora (Porque es nuestra tutora) en la universidad le añadieron mas trabajo y por eso se veía tan ocupada pero ella no tenia tiempo de explicar ni de tomarse con lujo de dátale la clase dejo investigar cada concepto y base a eso nosotros nos fuimos guiando.\n\nTambién cabe aclarar que manda tarea en la plataforma de Class Romm de google que me parece no es la plataforma institucional; No proporciona un rubrica de evaluación para sus proyectos y agrega en la hora de la entrega requerimientos (que ella no especifico y en la hora de la entrega se los va inventando) Mas que nada es buena la profa pero siento que la cargaron demasiado trabajo y es incapaz (o almenos de lo que observe en este cuatrimestre) de llevar tanto.'),
