(16871, 'Todas las clases era lo mismo, llegaba intentaba explicar un tema y no resolvía dudas ya que si intentaba resolverla siempre nos confundía mas, siempre dejaba exposiciones y así es difícil aprender ya que esa materia es mas fácil de aprender con practica y nunca lo vi programar en clase, solo hacia que hiciéramos programas complejos de cosas que el no había explicado.'),
(16871, 'Que mejore en su enseñanza hacia sus alumnos.'),
(16871, '1. El docente no explica del todo bien los temas, ademas de que su materia implica usar la computadora y nuestras clases solo tenemos 1 dia para usar el laboratorio de cumputo, y los otros dias es en el A3, a lo que implica que no podamos entender el tema a realizar y nos deja actividades por hacer y muchos compañeros carecen de laptops.\n2. El docente deja actividades que no ha ense;ado del todo bien, y nos deja actividades que mis compañeros no pueden entregar por que carecen de informacion que el profe no proporciona y lo unico que da como respuesta es \"Investiguenlo en internet\", entiendo el hecho de que tenemos que investigar un poco pero no estamos recibiendo la retroalimentacion por parte del docente y se nos hace injusto el modo con el que trabaja.\n3. El docente en una ocacion le queria explicar que si le entregue una actividad para poder tener una calificacion decente, pero a lo que me contesto con ignorancia y me respondio \"Que reclamas si ya tienes 8\", a lo que si me molesto bastante por que invalido la tarea que si habia entregado, y se me hace una falta de profesionalismo de su parte.'),
(16871, 'Da lo temas pero no explica o aclara las dudas, utiliza mucho que seamos autodidactas par aprender los temas pero al tener dudas no responde a ellas con ejemplos o con análisis de el cuestionamiento. Considero que no es una buena práctica el dejar actividades que después no califica o considerar actividades que no están registradas en alguna plataforma.'),
(16871, 'El docente no explica del todo bien los temas, además de que su materia implica usar la computadora y nuestras clases solo tenemos 1 día para usar el laboratorio de cómputo, y los otros días es en el A3, a lo que implica que no podamos entender el tema a realizar y nos deja actividades cuando aun no se ha comprendido del todo el tema, si bien lo de las computadoras puede ser un problema ajeno a el, lo de la retroalimentación si es algo que sucede por parte de el, no es lo mismo hacerlo en libreta que a la hora de programarlo.'),
(16871, 'Bueno... para empezar el profesor Manuel no enseña, en todo éste lapso de tiempo que nos ha proporcionado clases, no nos enseña, solo nos deja actividades con fechas de entregra muy cortas, solo nos deja exponer los temas que el nos debería explicar, regresando al tema de las actividades que no explica, si tardamos en entregarlo nos baja demasiado la calificación, sin escuchar el por qué fue tardía la entrega. Ya fue reportado con la Ing. Argeli, pero aún así no hacen nada. En verdad nos ayudarían demasiado cambiandonos de profesor, ya sea por el Doc. Gino o la Ing. Maria Jose.'),
