(16871, 'Considero que tiene aspectos a mejorar, ya que nos brinda los temas pero a la hora de la práctica nos pide cosas que con el no vimos, la mayoría de su asignatura tenía que resolverme mis dudas buscando en internet por mi cuenta. Considero que podría mejorar su enseñanza, igual influye mucho que solamente teníamos un día en laboratorio, entonces nos limitaba mucho a hacer códigos en su clase.'),
