(16874, 'Aquí me gustaría comentar un tema con esta profesora, así como para mí es muy buena maestra porque abarca todos los temas que debemos de ver, también tiene un punto en contra, y es el de que no respeta el horario establecido en su asignatura, ya que aconteció varias veces que ella misma recalcaba que ella no tenía la obligación de darnos ningún receso (teníamos con ella 2 horas seguidas de clase los lunes y 3 horas los miércoles), incluso a pesar de que le mandaron el nuevo horario donde aparecen los recesos estipulados, seguía diciendo lo mismo, que no era su obligación darnos los minutos. Considero que si se puede mejorar esto de los tiempos con esta profesora, fuera de eso todo bien.'),
