(47038, 'El profesor al inicio del cuatrimestre no daba clases prácticas teniendo en cuenta que su materia es un poco complicada y requeríamos de ejemplos claros, cuando daba su clase únicamente leía sus diapositivas y no daba ejemplos para que el tema quedara claro además que fomentaba las faltas de respeto con algunos compañeros en clases y les da preferencia en cuanto a calificaciones con las personas que tiene más acercamiento y nos daba a entender que si no podíamos con esa materia era mejor no tomarla y me parece que su forma de evaluar no es la adecuada cuando quiere que hagamos proyectos que en otros grupos lo hacen en todo un cuatrimestre y a nosotros nos lo dejo en 3 semanas, deberían tomar en cuenta la opinión de los alumnos y si esto es de manera repetitiva deberían tomar cartas en el asunto por el bien de la comunidad estudiantil.'),
