(46887, 'La materia y la maestra me dejó mucho que desear, si bien a lo largo de estos 2 cuatrimestres le ha bajado con su actitud déspota, apática y falta de profesionalismo, no quitó que siempre tuviera una buena organización en sus actividades y formas de evaluar, pero en este cuatrimestre el detalle fue que las actividades fueron puras exposiciones de principio a fin, que quiero decir con esto?, Que no dió absolutamente ninguna clase, ni retroalimentaciones al final de las exposiciones a excepción de la segunda unidad después de que pasará un equipo, se podría decir que las clases las dimos nosotros, no sé que le pasó este cuatrimestre, se verá mal pero parece que ya no quería trabajar, y es del tipo de maestras que si se quiere llegar un acuerdo para dejar otro tipo de actividades se la lleva en contra de los alumnos, entonces no se puede llegar a ningún lado con ella por miedo a una represalia acompañado de su actitud déspota y sarcástica aunque diga ser transparente con nosotros. Favor de revisar el plan de estudio o las actividades que dejarán a lo largo del cuatrimestre, la materia se veía muy interesante por el nombre, pero desgraciadamente no fue así. Con esto puedo decir que no podría recomendar la carrera por lo menos no en esta escuela. Gracias saludos cordiales.'),
