(47004, 'Considero que el contenido de su clase es bueno, sin embargo su forma de manejarse en clase tiene muchos puntos en contra, una persona poco empática, ocurrente a la hora de calificar (los criterios a evaluar en los trabajos no son claros y lo que se le va ocurriendo lo considera justo en la entrega de los trabajos y proyectos), una formación y dirección de equipos de trabajo injusta, autoritario, muestra de manera muy abierta la prefencia de alumnos en el grupo( más que nada a la hora de calificar), designa a alumnos a calificar proyectos que se supone le competen a él por el grado de análisis en el contenido(Si se tratase de un examen con respuestas ya escritas es considerado, pero un reporte con contenido muy especifico en la materia como para que alumnos de menor grado en la carrera lo califiquen, me parece insultante). Normalmente no me gusta entrar en conflicto, mucho menos con los profesores, me enseñaron a respetarlos ya que son la autoridad en el aula, sin embargo, debo expresar mi inconformidad con la forma de trabajar del ingeniero ya que logró que una materia de la cual tenia buenas expectativas se volviera mi materia menos deseada no por el contenido, sino por el ingeniero que la impartía. El grupo en general había tenido roses y problemas internos que justo en el cuatrimestre anterior a este se habían casi mitigado y la convivencia era más amena, ya todos dentro del salón de clases podíamos hablar con todos pero cuando se presentó la situación de como el ingeniero daba información y puntos extra a unos cuantos cuando se supone esa información debe ser a todo el grupo, el grupo entero entró en conflicto y el ambiente que costó demasiado poder mejorar se fue al caño, me dio mucha tristeza esa situación. Quizá un poco fuera de lugar el comentario pero este cuatrimestre sufrí ataques de ansiedad que no había tenido hace mucho, por la impotencia de estar en clase y saber que no importa que hiciera, sabia que lo que fuera que hiciera estaría mal por la falta de certidumbre en los criterios “ocultos” al calificar. Destaco que el contenido que muestra es muy especifico y enriquecedor, pero no sirve de nada si no se imparte de la manera correcta. '),
