(47053, 'De manera personal me he acercado a resolver dudas sobre la materia en este cuatrimestre  y en el anterior. Siempre me contestaba muy ambiguamente y me sentia excluida ya que se lleva bien con mis amigas y a ellas les resuelve dudas con paciencia. Por otra parte en la unidad 1 tenia 22 de 23 preguntas correctas en el examen y cuando pase a que asiente la calificación conto rápido y uso solo 18, le comente que estaba mal el numero y solo me respondió que no tenia tiempo y que era tarde y aun le faltaba por asentar a otros compañeros. Ademas nunca dio calificacion de la U1, U2 y ya vamos en la U3'),
(46925, '¡Excelente profesora!'),
(46932, 'Sin dudar es una excelente profesora pero su actitud a veces no es adecuada para ella existe preferencia con los alumnos, además no nos trata como personas adultas y siento que aveces llega enojada y se desquita con nosotros eso no me aparece justo.   '),
