(46918, 'Hay oportunidad de mejora como docente. '),
(47056, 'No me siento comoda en sus clases, suele ser grosera  y soberbia, realiza comentarios pasivo-agresivos hacia distintos compañeros, no es  abierta a el dialogo o nuevas opiniones, suele ser intolerante y solo lo que ella dice esta bien, la participacion en clase redujo por lo mismo. Suele hacer comentarios misoginos o chistes de esa indole como \"abrir onlyfans y producir tanto como Karely ruiz\". Una clase en especifico nos menciono que como profesionales si una chica viene de otro consultorio y esta con un trauma por abuso fisico y sexual que hariamos si no queria que la toquemos si la terapia manual era en los aductores, varios compañeros ofrecieron alternativas como que ella misma inicie o guiar alguien de confianza pero nos dijo que no, que la forma correcta era tocandola aun que ella no quiera por que sino no se iba a \"desensibilizar\", varios estuvimos en desacuerdo y realizo comentarios bastante soberbios sobre el tema, le comentamos que no podemos tocar a los pacientes en contra de su voluntar y mas si es en zonas delicadas y dijo que ella lo haria. Ha realizado muchos comentarios de ese tipo en sus clases. personalmente estoy decepcionada de la materia.'),
