(47056, 'Suele ser grosera con algunos alumnos en especifico, hace comentarios sarcasticos, no es tolerante al dialogo. Si llega haber algun inconveniente suele culpar a los alumnos aun que haya sido su error, y cuando se da cuenta de eso, en vez de reconocer el error solo es indiferente. Hace comentarios inapropiados, misoginos y sin tacto. Se disgusta cuando los compañeros van a Bienestar estudiantil( Paso en dos ocasiones con alumnos diferentes y no volvieron a reservar en su horario). Al inicio del cuatri hizo un comentario que me dejo marcada, ya que pensaba ir a recibir ayuda psicologica y la profa solo menciono que ella si era psicóloga clínica, no como la de la universidad. Sus comentarios de verdad desmotivan asistir a la clase por el ambiente incomodo.'),
