(46924, 'El profesor sabe, entiende y explica bien los temas vistos en clase, sin embargo es necesario ejemplificar más y de manera entendible las aplicaciones de los contenidos vistos en clase, usar contenido didáctico  complementario pues usa solamente diapositivas. También es necesario que los profesores en general evalúen los temas vistos por unidad, no muchos temas en una sola evaluación pues satura al alumno con problemas de varios temas, esto hace que la mayoría (que no comprende los temas por completo) repruebe la evaluación. De todos los compañeros solo pasaron unos 6 en su evaluación.'),
(46918, 'Una muy buena profesora, inteligente y preparada. Motiva, en lo personal, a prepararse lo mejor posible en tareas como exposiciones y exámenes pues cuestiona al alumno, lo hace pensar y analizar. En estea materia tuvimos la oportunidad de estar más en el laboratorio, lo que permitió también a los equipos a investigar y elaborar diseños de experimentos interesantes para el desarrollo de nuestros proyecto lo cual fue ha sido trascendente para comprender más nuestra carrera y sus aplicaciones. '),
(46921, 'Muy buen profesor '),
(46921, 'En esta materia sí hizo falta el uso de material didáctico de apoyo, cómo el visual, ya que es una materia con mucho contenido teórico que empezó a ser tedioso hasta cierto punto, pues perdías el interés por aburrimiento. Clases más entretenidas, sesión de preguntas a bases de lecturas de los temas visto en clase, actividades en equipo en donde se relacionen los temas vistos en clases, más dinamismo. '),
(46996, 'No es mala profesora, enseña muy bien, sin embargo su actitud no es la mejor, llega a tomarse personalmente asuntos de clase y eso no es mi agrado '),
(46923, 'Hace falta poner en práctica la teoría explicada en clase, ojalá pudiera hacer leer y hablar al alumno en inglés para reforzar los temas al realizar actividades extra a los que marca el libro.'),
(46952, 'Siempre me considere una persona que aunque no sabia ingles, pasaba la materia (prepa)m pero la profa explica de una manera en la que realmente estoy aprendiendo y responde mis dudas sobre la materia.'),
(46950, 'Agradezco infinitamente la paciencia que tiene con todos, en especial conmigo que muchas veces tenia demasiadas dudas porque no logro comprender a la primera y ella siempre me respondía tanto con ejemplos y explicaciones mas detalladas incluso hasta dándome sugerencias para que yo estudie, sin duda una excelente profesora con amor a su profesión'),
(46948, 'Honestamente no siempre entiendo su materia, muchas veces me toca estudiar hasta 2-3 horas después de la universidad para poder ir a un nivel medianamente decente, pero su trabajo es admirable, la capacidad de explicación que tiene y la comprensión con muchos de nosotros, hace su trabajo justo aunque muchas veces nosotros lo vemos demasiado pesado, busca explotar nuestras capacidades mientras de distintas maneras nos apoya, tal vez lloro de frustración por su materia, pero honestamente he aprendido mas de lo que puedo imaginar en una materia pesada como lo es calculo, le tengo el suficiente aprecio para decir que hace un gran trabajo aunque muchos no lo veamos siempre de la mejor manera, siempre mantendré que es una profesora admirable y hace un gran trabajo, solo tenga un poco mas de paciencia, no siempre recuerdo todos los temas.'),
(46953, 'Debería avisar desde el comienzo el objetivo final ya que, honestamente no he aprendido como tal de que trata la materia si estamos programando y esto debería ser documentación, desde mi punto de vista es incongruente una sobreexplotación por un gran proyecto que se asumió seria ficticio y al final seria programado en exageración para nuestras capacidades'),
(46954, 'He aprendido lo suficiente con ella, explica casi siempre de una manera paciente y con detalles, sin embargo debería trabajar en su paciencia, ya que siento que aunque no sea mi caso, a veces sus comentarios pueden y desaniman a varios estudiantes cuando ella debería motivarlos y apoyarlos. Fuera de eso, agradezco la atención que tiene con muchos, aunque a veces siento que me presiona.'),
