(46999, 'gran profe'),
(47001, 'gran profesora'),
(46914, 'El método de enseñanza es muy ambiguo y con huecos de aprendizaje pues no se da el tiempo necesario para comprender correctamente los temas'),
(46952, 'Excelente maestra de las mejores que eh tenido en todo el tiempo que llevo en la universidad '),
(46954, 'Bien'),
(46949, 'Buen profesor, muy claro y siempre apoyando a los alumnos y muy atento a todo'),
(46951, 'Cómo quiero mucho a esta maestra, la mejor que hay en la universidad '),
(46953, 'Buen maestro, aunque a veces se sale de su tema y mete cosas que no van de acuerdo a la asignatura '),
(46950, 'Se la pasa enseñando teoría con diapositivas sacadas de internet, nunca ha abierto un visual studio o un xampp. No sabe nada práctico, pues le preguntas y no te soluciona nada.'),
(46948, 'La maestra perfecta por excelencia, guapa, agradable, amigable, explica muy bien los temas, siempre está atenta a los alumnos y siempre está disponible, ojalá flor sea eterna '),
(46950, 'Buena explicando, buenos ejercicios que deja, exámenes apropiados, no se le puede pedir nada más '),
(46951, 'La mejor por mucho, planea sus clases con anticipación, es ordenada y muy clara con los temas a tratar.'),
(46979, 'Su manera de enseñar es peculiar...'),
(46951, 'No está mal pero no me sentí cómodo '),
(46978, 'Sin comentarios...'),
(46981, 'Excelente docente...'),
(46980, 'Bien, solo que es algo chismosa.'),
(46948, 'Me intimida que esté siempre serie en clases :('),
(46982, 'La mayoría de sus clases hablaba de su otro trabajo. Y en la escuela casi no hay señal de internet y evaluaba con kahoot y no podía hacer los tipos exámenes ademas que tenian tiempo. Es una manera mas dificil y de presión. '),
(46948, 'Excelente profesora'),
(46950, 'Excelente profesora'),
(46952, 'Excelente profesora'),
(46980, 'Buena manera de comunicación'),
(46954, 'La primera vez que la maestra Majo nos da clases, y con un cuatrimestre de conocerla puedo decir que es y seré una de las mejores maestras que voy a tener en la Ingenería, la pasión en la que enseña, esa delicadesa y no para mal, sino hablo de que procura que el tema se comprenda lo mejor posible, espero volverla a tener como profesora en los proximos cuatrimestres sé que aprendere mucho más de ella<33 '),
(46950, 'Las clases con ella se me hacen muy interesantes, la paciencia de la maestra Heidy es tan sorprendente para mí, busca que aprendas desde la teoría y la práctica obviamente. '),
(46949, 'El profesor le falta experiencia o madurez como profesor? Tal vez. A veces es preocupante en la manera que no aprendo con el, o la manera que lo explica, luego sus faltas constantes también es algo que preocupa, tal vez al principio lo tomemos como un \"descanso\", pero luego esos descansos nos afectan más.'),
(46953, 'El profesor, bueno no sé como sea el plan de esta materia, como tal en teoría sí, vaya es \"requerimientos\" , programar no se si es algo extra con su materia, tal vez, si o tal vez no. Pero si ponerse algo exigente con su proyecto con varios modulos para programar, no me parece.'),
(46979, 'es una exelente maestra pero que por favor de un poco mas de tiempo para hacer las actividades y que explique de otras maneras los temas dados en clase que se entiendan para que se entiendan mejor'),
(46983, '!La mejor maestra¡'),
(46978, 'buen profe'),
(46951, 'La profesora Elizabeth es una excelente maestra, lo especial que son sus clases la manera que trasnmite el tema a tratar, cuando existe una duda en clases la resuleve de la mejor manera<33'),
(46981, 'enseña muy bien'),
(46945, 'la forma en la que da los temas muchas veces no lo suficientemente didactica para mantenernos despiertos '),
(46943, 'Denle mas grupos el próximo cuatri'),
(46920, 'cuando enseña mate deberia de dejar un poco mas de ejercicios para casa pero no evaluarlos como parte de la calificación normal si no como decimas extra '),
(46941, 'La verdad es que estoy bastante insatisfecho con la labor ejercida por parte del docente, desde su metodologia empleada en clase como en su forma del trato diario en clase. Ya que muchas veces a llegado a insinuar su conocimiento de una forma soberbia y despota haciendo sentir incomodo a mas de un compañero. Con respecto a su metologia de enseñanza la verdad es que no es nada didáctico ni mucho menos interesante, desde sus diapotivas que son cero llamativas o atractivas visualmente (como nos han enseñado a lo largo de toda nuestra vida escolar), su forma de dirigir en el laboratorio es simplemente desesperante ya que te trata como sino supieras lo que estas haciendo (esto sin antes tener una duda acerca de como se hace), te llegas a sentir afixiado con su presencia y esto provoca un estres de forma mayuscula en mí y en todos mis compañeros  y por ultimo punto muchas veces nos llega a pedir cosas que en cuestion de tiempo y disponibilidad de tiempo del laboratorio esto llega a hacer imposible. En los casi dos años que llevo en esta universidad nunca había tenido una experiencia tan desagrable como con este profesor. Solo espero y en verdad tomen enserio mi comentario y el de mis compañeros, gracias y buen día.'),
(46942, 'no he tomado como tal clases con ella debido a que exente todos los cuatrimestres de ingles '),
(46939, 'Un excelente profesor en su laborcomo docente como en su trato díario con el alumno, una bella persona. '),
(46939, 'De los mejores profesores que me han dado clases '),
(46943, 'Me gusta su manera de enseñar, digamos que es algo nuevo para mí. Pero estoy conforme ya que trata de relacionarte con el tema y si tienes dudas te las explica de una manera clara y digerible.'),
(46941, 'Es una persona exasperante, se beneficiaria bastante con afecto femenino y terapia. Suele hacer sentir menos a los alumnos cuando demuestran que les hace falta conocimiento en algo que en teoría deberían saber, a demás de que es una persona inmiscuida '),
(46945, 'Un buen docente en terminos generales. Suele explicar bien los temas (ya no son temas tan sencillos de digerir), podria mejorar en cuanto a su forma de dar clase y ser mas didáctico pero en general una buena persona y buen docente.'),
(46940, 'Una buena docente, hace entrenida y divertida su clase'),
(46942, 'Una buena docente, sin embargo, suele meter proyectos cuando tenemos 2 proyectos aparte de diversas materias entonces como consecuencia crea a un más estrés '),
(46944, 'Un grande entre grandes el y su coche anfibio. El que diga que no, no solo esta equivocado es estúpido no leo lloros, buen día.'),
(46960, 'Buen profesor, explica todo de forma entendible, falta mas dinamismo en sus clases'),
(46959, 'Buen profesor en general las clases me parecieron interesantes y divertidas'),
(46956, 'Todo bien y claro a la hora de aclarar cosas respecto a la materia'),
(46989, 'Es una buena profesora de inglés como las anteriores que me han dado clases.'),
(46933, 'Su desempeñó en esta materia fue buena a comparación de otras dadas, solo que con varias faltas'),
(46941, 'No estoy satisfecha con su forma de ensañar, no me siento en confianza para preguntar alguna duda. Se a comportado un poco grosero en lo personal, debería tener un poco más de empatía con el estudiante'),
(46940, 'muy buena maestra ! la quiero mucho :\')'),
(46939, 'Muy bien profesor, me ayudó mucho con problemas escolares.'),
(46936, 'exelente docente'),
(46939, 'Excelente como profesor :)'),
(46938, 'Buen profesor '),
(46935, 'La verdad es un profesor con el que sientes la confianza de participar y insista a participar con su modo de enseñanza '),
(46932, 'Es una excelente Maestra, es estricta pero también razonable '),
(46934, 'Es buena maestra, pero de mi parte siento que me confundo un poco con sus explicaciones '),
(46936, 'Es un excelente profesor que siempre te da la confianza de participar y explica las cosas hasta el punto dónde todos entiendan '),
(46933, 'Extrañamos al profesor Christian '),
(46930, 'Muy buen profesor'),
(46934, 'Buena profesora'),
(46935, 'Excelente profesor'),
(46938, 'Buen profesor '),
(46932, 'Buena profesora'),
(46929, 'Es buena profesora y da buenas clases, sin embargo muchas veces no me animo a preguntar mis dudas porque me siento intimidada por la forma en que llega a contestar o siento que recibire un regaño en vez de una explicación ya que aveces nos realiza comentarios como \"si no saben pues que hacen aqui\" y eso me causa menos confianza al momento de quere externar mis dudas, de igual forma cuando exponemos me siento muy presionada por la forma en la que realiza las preguntas '),
(46931, 'Me cuesta mucho trabajo seguir el ritmo del profesor, aveces siento que lo que estudio que vimos en clase no se asemeja a lo que realizamos en el examen, hay momentos en los que no da charlas y lejos de motivarme me hace cuestionar si realmente debo o no seguir en la carrera'),
(46926, 'Me gustaria que realice mas actividades recreativas que nos quiten el estres un rato de las demas materias'),
(46927, 'Este cuatrimestre el profesor dejó mucho que desear. Todas las clases fueron o reuniones entre equipos para leer PDFs o exposiciones, no hubo clases impartidas por el profesor para abordar los temas que se supone debimos ver. '),
(46925, 'Es muy buena profesora, aborda los temas de una manera que sea fácil de comprender para todos.'),
(46948, 'Buena profa'),
(46929, 'En cuatris pasados sus clases eran muy buenas y se aprendia bastante, en este no podría decir lo mismo, lo sentí saturado, se le dió mucho enfoque a que los proyectos salgan bien, dejando de lado clases donde de verdad estemos aprendiendo y no solo recibiendo información '),
(46952, 'I don\'t speak in english'),
(46954, 'Podria mejorar'),
(46949, 'Hace falta mas actividades practicas pero con acompañamiento del maestro'),
(46951, 'Buena profesora en general'),
(46987, 'No tuve clases con este profesor '),
(46988, 'Últimamente se toma las cosas de manera personal, no me gusta que a veces llega de mal humor a la clase y está como sensible, cualquier cosa que le lleguen a decir le afecta.'),
(46988, 'Es un profesor que dependiendo de su estado de animo, dará la clase, sí esta feliz, lo dará con alegría pero si está molesto o de malas se desquita con la clase, en ese aspecto no es profesional, además de que todo se lo toma de forma personal y eso está mal, puesto que no hay profesionalismo en el, grita mucho para un salón pequeño y dice cosas que sabe que está mal, pero finge de que no  '),
(46986, 'buen profe, explica de forma clara y precisa'),
(46990, 'buen profe, sabe enseñar y distribuirse bien con la clase'),
(46985, 'buen profe, sabe mucho y enseña bien'),
(46987, 'es preciso al momento de explicar lo que se ocupa y se va a hacer'),
(46989, 'excelente profesora, sabe explicar bien las clases y siempre busca formas de enseñar que sean entretenidas y divertidas y por ende uno aprende y se divierte, sabe corregir y siempre enseña los puntos del ingles que es escribir, leer y hablar'),
(46984, 'buen profe'),
(46982, '.');
